import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Stack from '@mui/system/Stack';
import Button from '@mui/material/Button';
import { useState, useEffect} from 'react';

const Form = () => {
    const [importId, setImportId] = use([]);
    const [node, setNode] = useState({})

    const handleChange = (event) => {
        setUserId(event.target.balue)
    }

    const handleSubmit = (event) => {
        useEffect(() => {
            fetch('http://localhost:9092/get-node?id=${importId}')
            .then((res) => res.json())
            .then((data) => {
                console.log(data);
                setNode(data);
            })
            .catch((err) => {
                console.log(err.message);
            })
        })
    }

  return (
    <Box
    component="form"
    sx={{
        '& > :not(style)': { m: 1, width: '25ch' },
    }}
    noValidate
    autoComplete="off"
    >

        <Stack spacing={4}>
            <TextField id="filled-basic" label="Import Id" variant="filled" onChange={handleChange}/>
            <Button variant="contained" onSubmit={handleSubmit}>Submit</Button>
        </Stack>

    </Box>
  )
}

export default Form;
